import Head from "next/head";
import Navbar from "./Navbar";
import NewsFeedItem from "./NewsFeedItem";

const Layout = (props) => (
  <div>
    <Head>
      <title>Demo App</title>
    </Head>
    <Navbar>
      <div className="container">{props.children}</div>
    </Navbar>
    <CardDeck>
      <NewsFeedItem />
    </CardDeck>
  </div>
);

export default Layout;
